import React, { useEffect, useState } from "react";

function Home() {
  const [locations, setLocations] = useState([]);
  console.log(locations);
  useEffect(() => {
    fetch("/locations.json")
      .then((response) => {
        response.json();
      })

      .then((data) => {
        setLocations(data);
      });
  }, []);
  console.log();
  return <div></div>;
}

export default Home;
